import React from 'react'
import ContactBtn from '../ContactBtn'
import Header from '../Header'
import ProjectElement from '../ProjectElement'

function Smarthive() {

    // const images = [
    //     "./resources/bgdefault.jpg",
    //     "./resources/bg1.jpg",
    //     "./resources/bg2.jpg",
    //     "./resources/bg3.jpg",
    //     "./resources/bg4.jpg",
    //     "./resources/bg5.jpg",
    //     "./resources/bg6.jpg",
    //     "./resources/bg7.jpg",
    //     "./resources/bg8.jpg"
    //   ]
    // const items = [{ name: 'item 1' }, { name: 'item2' }];
    
    const technology = [{ name: 'Wordpress' }, { name: 'Elementor' }, {name: 'CSS'}, {name: 'JS'}, {name: 'PHP'}];

    return (
        <div>
            <ContactBtn/>
            <Header title='Smarthive' back='/portfolio'/>
            <ProjectElement 
                name='Strona Smarthive'
                src='/assets/Smarthive.png'
                description="Prosta i elegancka strona oparta na Wordpressie. W pełni responsywna, pozwala na dodawanie postów z wiadomościami. 
                Wygląd strony był kompromisem pomiędzy minimalistycznym podejściem w tworzeniu nowoczesnych stron, a poprzednią wersją strony."
                technology={technology}
                nolink="Strona już nie istnieje"
            />
        </div>
    )
}

export default Smarthive
